INSERT INTO Incident (id, name, description, solution, create_date) VALUES (1,'INC1107398','Client is trying to give admin access to his employee with access only to change hours and deductions and submit payroll','The initial screen shots from the field shows the amounts.  We set up a role for a user in production that matched the same privileges as the role in the original pdf.  In the screen shots I sent you, the rates, shift, etc. that is secured by Pay Rates and Salary Amounts component, Earnings/Deduction Calculation component, and Payroll Overrides show that the values are masked correctly.    If all users assigned to Scott''s Role are having the same issue, then perhaps create a new custom role and see if they are still having the same problem.','2019-10-22 11:11:19.585759');
INSERT INTO Incident (id, name, description, solution, create_date) VALUES (2,'INC1116948','Employee receives attached critical error when trying to migrate to flex','Regarding user jcav1987 DEV asked that we purge that BOL user again. They would like the user to follow the account registration into Flex utilizing the instructions given in AskIT #161010110821649. Also have them use a slightly different username from the last one.','2019-10-22 11:11:19.585759');
INSERT INTO Incident (id, name, description, solution, create_date) VALUES (3,'INC1113942','Employees unable to view or download reports when in Flex, because PRS cannot get Online Packages to populate for the accounts','Mark Mraz: I have updated the EE_VISIBLE flag on most of the check stubs for the two clients for the dates requested. A few of the check stubs had been voided. I did not make those visible.','2019-10-22 11:11:19.585759');
INSERT INTO Incident (id, name, description, solution, create_date) VALUES (4,'INC1113599','MetricAlertCustom: BSM9: Unique ID ProcRunner Failure: /EnterpriseService/ScheduledEnterpriseMessage/00471R9MIVTSPMIZIHXR/A8012837','This Incident has been resolved based on the resolution of an associated Parent Incident, INC1062743. Service is expected to be restored.','2019-10-22 11:11:19.585759');
INSERT INTO Incident (id, name, description, solution, create_date) VALUES (5,'INC1111372','Benefits admin the only benefits option available to admin when logging into their personal account','In BeneTrac the EE user is not provisioned for access (only the admin is). Please re-provision the EE user account. This will send the partnerguid over to BeneTrac to complete the linking. Also, please have the user ensure her bday on the flex employee record is correct. In CA it was entered as 1989-04-04.','2019-10-22 11:11:19.585759');
INSERT INTO Incident (id, name, description, solution, create_date) VALUES (6,'INC1113621','Problem with access to Payroll','All client applications updated.','2019-10-22 11:11:19.585759');
